package com.kucaroom.mypicture.responseObject;import com.fasterxml.jackson.annotation.JsonProperty;import lombok.Data;/** * 用户数据返回对象 */@Datapublic class UserRO {    @JsonProperty("user_id")    private Integer id;    /** 所属的小程序 */    @JsonProperty("app_id")    private Integer appId;    /** 昵称 */    @JsonProperty("nickname")    private String nickname;    /** 头像 */    @JsonProperty("avatar")    private String avatar;    /** 性别 */    @JsonProperty("gender")    private Integer gender;}